            //string s = "aabbccddeefghi";
            //string resExp = "NO";

            //string s = "abcdefghhgfedecba";
            //string resExp = "YES";

            //string s = "aaaabbcc";
            //string resExp = "NO";

            //string s = "aabbc";
            //string resExp = "YES";

            //string s = "";
            //string resExp = "YES";

            string s = "";
            string resExp = "YES";

            string result = isValid(s);

            if (resExp != result)
            {
                Console.WriteLine("Errore - Expected: " + resExp + " - now: " + result);
            }
            else
            {
                Console.WriteLine("Perfetto!!!");
                Console.WriteLine(result);
            }
        }

        static string isValid(string s)
        {
            Dictionary<char, int> t = s.GroupBy(x => x).OrderBy(e => e.Count())
                                                        .ToDictionary(p => p.Key,
                                                                        p => p.Count()
                                                                    );

            int countGr = t.Count();

            if (countGr == 1)
            {
                if (t.First().Value > 2)
                {
                    return "NO";
                }
                return "YES";
            }

            int nElem = t.Select(e => e.Value).Distinct().Count();
            if (nElem > 2)
            {
                return "NO";
            }

            int chNumMax = t.Select(e => e.Value).GroupBy(x => x).OrderByDescending(k => k.Count()).Select(g => g.Key).First();

            var otherMax = t.Where(e => e.Value != chNumMax).Select(f => f.Value);

            if (otherMax.Count() > 1)
            {
                return "NO";
            }
            if (otherMax.Count() == 0)
            {
                return "YES";
            }

            if (otherMax.First() > chNumMax)
            {
                if (otherMax.First() - chNumMax > 1)
                {
                    return "NO";
                }
            }
            else
            {
                if (otherMax.First() > 1)
                {
                    return "NO";
                }
            }

            return "YES";
        }
    }
